descripcion:
a 20 pasos de la av.18 de marzo cerca de todos los servicios, zona muy segura y conectada con vialidades principales, esta construida en dos plantas; 
planta baja; estancia, comedor, medio baño, cocina integral independiente, dos patios de servicio, cuarto de servicio con baño completo, cochera dos autos. 
planta alta; cuatro recamaras, dos baños completos, excelente oportunidad de inversión.

terraza para eventos; 
bien ubicado en zona belisario, 700 metros de terreno, 300 metros aprox de construcción , cuenta con todos los servicios (baños, cocina,amplia entrada), aclientado,en perfectas condiciones. 
(arrendatario dispuesto a seguir administrando el negocio)
